verify_msg(Msg) when tuple_size(Msg) >= 1 ->
    verify_msg(Msg, element(1, Msg), []);
verify_msg(X) ->
    mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName) when is_atom(MsgName) ->
    verify_msg(Msg, MsgName, []);
verify_msg(Msg, Opts) when tuple_size(Msg) >= 1 ->
    verify_msg(Msg, element(1, Msg), Opts);
verify_msg(X, _Opts) ->
    mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
      p_target_task ->
	  v_msg_p_target_task(Msg, [MsgName], TrUserData);
      m_target_info_tos ->
	  v_msg_m_target_info_tos(Msg, [MsgName], TrUserData);
      m_target_info_toc ->
	  v_msg_m_target_info_toc(Msg, [MsgName], TrUserData);
      m_target_get_skill_tos ->
	  v_msg_m_target_get_skill_tos(Msg, [MsgName],
				       TrUserData);
      m_target_get_skill_toc ->
	  v_msg_m_target_get_skill_toc(Msg, [MsgName],
				       TrUserData);
      m_target_get_reward_tos ->
	  v_msg_m_target_get_reward_tos(Msg, [MsgName],
					TrUserData);
      m_target_get_reward_toc ->
	  v_msg_m_target_get_reward_toc(Msg, [MsgName],
					TrUserData);
      _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


-compile({nowarn_unused_function,v_msg_p_target_task/3}).
-dialyzer({nowarn_function,v_msg_p_target_task/3}).
v_msg_p_target_task(#p_target_task{id = F1,
				   finished = F2, status = F3},
		    Path, TrUserData) ->
    v_type_int32(F1, [id | Path], TrUserData),
    if is_list(F2) ->
	   _ = [v_type_int32(Elem, [finished | Path], TrUserData)
		|| Elem <- F2],
	   ok;
       true ->
	   mk_type_error({invalid_list_of, int32}, F2,
			 [finished | Path])
    end,
    v_type_int32(F3, [status | Path], TrUserData),
    ok;
v_msg_p_target_task(X, Path, _TrUserData) ->
    mk_type_error({expected_msg, p_target_task}, X, Path).

